import React from "react";

const AboutMe = () => {
  return (
    <section id="About">
      <div className="container">
        <div className="heading">
          <h2>About</h2>
        </div>
        <div className="row">
          <p>
            Aspiring and creative Full Stack Web Developer with in expertise in
            MERN. Self motivated and curious to develop user-centric products.
            Looking forward to working in a driven company where I can implement
            my skills and grow with the growth of the organization.
          </p>
        </div>

      </div>
    </section>
  );
};

export default AboutMe;
